import Room from "../components/Room";
import GlobalStyle from "../components/styles/GlobalStyles";
import { connect } from "react-redux";
import Container from "../components/styles/StyledRoomContainer";
import { checkRoom } from "../redux/actions/roomActions";
const Index = ({ roomObj: { rooms } }) => {
  return (
    <div>
      <h1>Rooms</h1>
      <GlobalStyle />
      <Container>
        {rooms.map(room => {
          return <Room key={room.id} room={room} checkRoom={checkRoom} />;
        })}
      </Container>

      <button>Submit</button>
    </div>
  );
};
Index.getStaticProps = ({ store }) => {
  // console.log("s", store);
};
const mapStateToProps = state => ({
  roomObj: state.roomObj
});

export default connect(mapStateToProps, { checkRoom })(Index);
